import React, { useState } from "react";
// import Results from "../result/Results";

const PageTwo = (props) => {
  const [img, setImg] = useState();
  const [display, setDiaplay] = useState(false);

  const img1 = `https://source.unsplash.com/400x200/?${img}`;
  const img2 = `https://source.unsplash.com/150x200/?${img}`;
  const img3 = `https://source.unsplash.com/130x200/?${img}`;
  const img4 = `https://source.unsplash.com/155x200/?${img}`;
  const img5 = `https://source.unsplash.com/122x200/?${img}`;
  const img6 = `https://source.unsplash.com/300x200/?${img}`;

  const handleInput = (e) => {
    const data = e.target.value;
    setImg(data);
    setDiaplay(true);
  };

  return (
    <div>
      <input
        type="text"
        placeholder="find your place image"
        onChange={handleInput}
      ></input>

      <img src={img1} alt="search" />
      <img src={img2} alt="search" />
      <img src={img3} alt="search" />

      <img src={img4} alt="search" />
      <img src={img5} alt="search" />
      <img src={img6} alt="search" />

      {/* {img === "" ? null : <Results name={img} />} */}
    </div>
  );
};

export default PageTwo;
